import * as React from 'react';

export const Main: React.FC = () => {
  const weather = async () => {
    await fetch(
      `api.openweathermap.org/data/2.5/weather?q={'London'}&appid=6cd33f76e223beefab317e542a910250`
    ).then(res => console.log(res));
  };
  return <div className="">It is working {weather()}</div>;
};
